import { MDBIcon } from "mdbreact";
import styles from './UserOption.module.css'
const UserOption = ()=>{

    return(
        <div style={{display:"flex", width:"25%", flexWrap: "wrap", justifyContent:"center"}}>
            <div className = {styles.segment} ><MDBIcon icon="user" className="text-black" size="2x"/> <div>Sign Up</div> </div>
            <div className = {styles.segment} ><MDBIcon icon="edit" className="text-black" size="2x"/> <div>Log In</div> </div>
            <div className = {styles.segment} ><MDBIcon icon="bell" className="text-black" size="2x"/> <div>Notification</div> </div>
            <div className = {styles.segment} ><MDBIcon icon="question" className="text-black" size="2x"/> <div>Help</div> </div>
        </div>
    )
}

export default UserOption ;
